package com.interview.leetcode.expert;

import java.util.Stack;

public class MorganAndString {

    public static void main(String[] args) {
//        System.out.println(morganAndString("ACA", "BCF"));
//        System.out.println(morganAndString("", ""));
        System.out.println(morganAndString("BABAABABBBAA", "BABAABABBBAA"));
        //        System.out.println(new String("").length());
    }

    public static String morganAndString(String a, String b) {
//        a += "Z";
//        b += "Z";
        Stack<Character> stackA = new Stack<>();
        for (int i = a.length() - 1; i >= 0; i--) {
            stackA.push(a.charAt(i));
        }
        Stack<Character> stackB = new Stack<>();
        for (int i = b.length() - 1; i >= 0; i--) {
            stackB.push(b.charAt(i));
        }

        StringBuilder result = new StringBuilder();
        while (stackA.size() != 0 && stackB.size() != 0) {
            Character bigger = compareChars(stackA, stackB);
            result.append(bigger);
        }
        if (stackA.size() != 0) {
            while (!stackA.isEmpty()) result.append(stackA.pop());
        }
        if (stackB.size() != 0) {
            while (!stackB.isEmpty()) result.append(stackB.pop());
        }
        System.out.println(result.length());
        return result.toString();
    }

    private static Character compareChars(Stack<Character> stackA, Stack<Character> stackB) {
        Character peekA = stackA.peek();
        Character peekB = stackB.peek();
        return peekA <= peekB ? stackA.pop() : stackB.pop();
    }

}